"use strict";function PerfectCurve(a,b,c){this.totalFrames=100,this.distance=100,this.startPoint=0,this.init(a,b,c)}PerfectCurve.prototype.init=function(a,b,c){this.startPoint=isNumber(a)?a:0,this.distance=isNumber(b)?b:0,this.totalFrames=isNumber(c)?Math.floor(c):1,this.angleProport=this.getAngleProportion()},PerfectCurve.prototype.getAngleProportion=function(){return 90/this.totalFrames},PerfectCurve.prototype.moveProportion=function(a){if(isNumber(a)&&Math.round(a)===a){var b=a*this.angleProport;return b=Math.PI/180*b,this.startPoint+this.distance*Math.sin(b)}};